import React from 'react';
import './Pokemon.js'

class Pokemom extends React.Component {
  render() {
    const pokemom = this.props.pokemom;
    return (
      <div>
        <p>{pokemom.name}</p>
        <p>{pokemom.type}</p>
        <p>{pokemom.name}</p>
        <p>averageWeight: {pokemom.averageWeight.value}</p>
        <img src={pokemom.image} alt='pokemon'></img>
      </div>
    )

  }
}

export default Pokemom;
